import React, { Component } from 'react';
import './Searchbar.scss';

import Users from './Components/Users';

class Searchbar extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <div className="c-searchbar-box-wrapper">
      <input type="text" placeholder="Chrcher un inscrit" className="searchbar-box_input" />
      <button className="searchbar-box-button">ajouter icone</button>
      </div>
    );
  }
}

export default Searchbar;
